window.bookSummaryJSON = "<p>From <i>USA Today</i> best-selling author Gigi Pandian comes a modern tale of ancient intrigue. </p> <p>Unpacking her belongings in her new hometown of Portland, Oregon, herbalist and reformed alchemist Zoe Faust can't help but notice she's picked up a stowaway. Dorian Robert-Houdin is a living, breathing three-and-half-foot gargoyle - not to mention a master of French cuisine - and he needs Zoe's expertise to decipher a centuries-old text. Zoe, who's trying to put her old life behind her, isn't so sure she wants to reopen her alchemical past... until the dead man on her porch leaves her no choice. </p> <p>Includes recipes!</p>"; 
